import { Inject, Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { marked } from 'marked';
import { map, Observable } from 'rxjs';
import { highlightCodeBlock } from './highlight-code-block';
import { STORY_CONFIG, StoryConfig } from '../story';
import { DocsMarkdownRenderer } from './docs-marked-renderer';

@Injectable({
  providedIn: 'root'
})
export class MarkedService {

  constructor(@Inject(STORY_CONFIG) private config: StoryConfig, private http: HttpClient) {

    // Custom markdown renderer for transforming markdown files for the docs.
    const markdownRenderer = new DocsMarkdownRenderer();

    // Set highlight.js in marked
    marked.setOptions({ renderer: markdownRenderer, highlight: highlightCodeBlock });
  }

  getMarkDownHtml(name: string): Observable<string> {
    return this.http.get(`${ this.config.markdownDirPath }/${ name }.md`, { responseType: 'text' }).pipe(
      map((res: string) => marked.parse(res))
    );
  }
}

import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import { map, publishReplay, refCount } from 'rxjs/operators';
import * as Chance from 'chance';
import { GalleryItem, ImageItem } from 'ng-gallery';

import { Hit2, PixabayHDModel } from './pixabay.model';

@Injectable({
  providedIn: 'root'
})
export class Pixabay {

  private readonly chance = new Chance();
  private readonly API_KEY = '560162-704dd2880c027f22c62ab7941';

  constructor(private _http: HttpClient) {
  }

  getHDImages(key: string, count: number = 20): Observable<GalleryItem[]> {
    const URL = `https://pixabay.com/api/?key=${ this.API_KEY }&q=${ encodeURIComponent(key) }&response_group=high_resolution&editors_choice=true&per_page=${ count }`;
    return this._http.get(URL).pipe(
      map((res: PixabayHDModel) => {
        return res.hits.map((item: Hit2) => new ImageItem({
          src: item.largeImageURL,
          thumb: item.previewURL,
          fullHDURL: item.fullHDURL,
          text: this.chance.paragraph(),
          title: this.chance.name()
        }));
      }),
      publishReplay(1),
      refCount()
    );
  }
}

import { Inject, Injectable, Optional } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { ComponentType } from '@angular/cdk/portal';
import { BehaviorSubject, filter, map, Observable, take } from 'rxjs';
import { STORY_CONFIG, StoryConfig } from './story.model';
import { StoryRoute } from '../components-page/components.data';
import { CompoDoc } from '../../documentation.model';

@Injectable({
  providedIn: 'root'
})
export class StoryService {

  private readonly docSource = new BehaviorSubject<CompoDoc>(null);

  readonly documentation: Observable<CompoDoc> = this.docSource.pipe(
    filter((docs: CompoDoc) => !!docs),
    take(1)
  );

  readonly routes: Record<string, StoryRoute>;

  readonly stories: Record<string, ComponentType<unknown>>;

  constructor(@Optional() @Inject(STORY_CONFIG) config: StoryConfig, private http: HttpClient) {
    // Load CompoDoc documentation
    this.http.get(config.documentationPath).pipe(
      map((res: CompoDoc) => this.docSource.next(res))
    ).subscribe();

    this.routes = config.routes.reduce((total: Record<string, StoryRoute>, route: StoryRoute) => {
      return {
        ...total,
        [route.path]: route
      };
    }, {});

    this.stories = config.components.reduce((total: Record<string, ComponentType<unknown>>, cmp: ComponentType<unknown>) => {
      return {
        ...total,
        [cmp.name]: cmp
      };
    }, {});
  }
}

