import { Component, Input, OnInit, ViewChild, ElementRef, ChangeDetectionStrategy, Output, EventEmitter } from '@angular/core';

@Component({
  selector: 'gallery-video',
  changeDetection: ChangeDetectionStrategy.OnPush,
  template: `
    <video #video [controls]="controls" [poster]="poster" (error)="error.emit($event)">
      <source *ngFor="let src of videoSources" [src]="src?.url" [type]="src?.type"/>
    </video>
  `
})
export class GalleryVideoComponent implements OnInit {

  videoSources: { url: string, type?: string }[];
  controls: boolean;

  @Input() src: string | { url: string, type?: string }[];
  @Input() poster: string;
  @Input('controls') controlsEnabled: boolean;

  @Input('pause') set pauseVideo(shouldPause: boolean) {
    if (this.video.nativeElement) {
      const video: HTMLVideoElement = this.video.nativeElement;
      if (shouldPause && !video.paused) {
        video.pause();
      }
    }
  }

  @Input('play') set playVideo(shouldPlay: boolean) {
    if (this.video.nativeElement) {
      const video: HTMLVideoElement = this.video.nativeElement;
      if (shouldPlay) {
        video.play();
      }
    }
  }

  /** Stream that emits when an error occurs */
  @Output() error = new EventEmitter<Error>();

  @ViewChild('video', { static: true }) video: ElementRef;

  ngOnInit() {
    if (this.src instanceof Array) {
      // If video has multiple sources
      this.videoSources = [...this.src];
    } else {
      this.videoSources = [{ url: this.src }];
    }
    this.controls = typeof this.controlsEnabled === 'boolean' ? this.controlsEnabled : true;
  }
}

import { Component, Input, ViewChild, AfterViewInit, ElementRef, ChangeDetectionStrategy, ChangeDetectorRef } from '@angular/core';
import { Platform } from '@angular/cdk/platform';
import { BehaviorSubject, of } from 'rxjs';
import { delay, finalize, map, take } from 'rxjs/operators';

@Component({
  selector: 'hl-code',
  templateUrl: './hl-code.component.html',
  styleUrls: ['./hl-code.component.scss'],
  changeDetection: ChangeDetectionStrategy.OnPush
})
export class HlCodeComponent implements AfterViewInit {

  state$ = new BehaviorSubject({
    copied: false,
    height: '100%'
  });
  @Input() code: string;
  @Input() height: number;
  @Input() disabled: boolean;
  @Input() track = 'vertical';

  @ViewChild('codeEL', {read: ElementRef}) codeEl: ElementRef;

  constructor(private cd: ChangeDetectorRef, private platform: Platform) {
  }

  ngAfterViewInit() {
    // this.updateHeight();
  }

  // updateHeight() {
  //   if (!this.height && this.codeEl) {
  //     this.updateState({height: this.codeEl.nativeElement.offsetHeight + 'px'});
  //   } else {
  //     this.updateState({height: this.height + 'px'});
  //   }
  //   this.scrollable.update();
  // }

  private updateState(state) {
    this.state$.next({...this.state$.value, ...state});
    this.cd.detectChanges();
  }

  copy() {
    of(this.code).pipe(
      map((text: string) => {

        // Create a hidden textarea element
        const textArea: HTMLTextAreaElement = document.createElement('textarea') as HTMLTextAreaElement;
        textArea.value = text;
        document.body.appendChild(textArea);

        // highlight textarea to copy the text
        if (this.platform.IOS) {
          const range = document.createRange();
          range.selectNodeContents(textArea);
          const selection = window.getSelection();
          selection.removeAllRanges();
          selection.addRange(range);
          textArea.readOnly = true;
          textArea.setSelectionRange(0, 999999);
        } else {
          textArea.select();
        }
        document.execCommand('copy');
        document.body.removeChild(textArea);
        this.updateState({copied: true});
      }),
      take(1),
      delay(3500),
      finalize(() => this.updateState({copied: false}))
    ).subscribe();
  }

}

